protected void seekInternal(long pos)
    throws IOException
{
    if (pos > length)
        throw new IOException("seeking past end of file");

    if ((pos >>> DbOutputStream.BLOCK_SHIFT) !=
        (position >>> DbOutputStream.BLOCK_SHIFT))
    {
        block.seek(pos);
        block.get(blocks, txn);
    }

    position = pos;
}

